"use strict";(self.webpackChunkmainstreamtoken_com=self.webpackChunkmainstreamtoken_com||[]).push([[5177],{5272:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"launch-announcement","metadata":{"permalink":"/news/launch-announcement","editUrl":"https://github.com/mainstreamorganization/mainstreamtoken.com/tree/main/news/2025-01-01-launch-announcement.mdx","source":"@site/news/2025-01-01-launch-announcement.mdx","title":"A Birthday Gift to Crypto: Mainstream Token Launches on Bitcoin\'s Anniversary","description":"{/ truncate /}","date":"2025-01-01T00:00:00.000Z","tags":[{"inline":true,"label":"launch","permalink":"/news/tags/launch"},{"inline":true,"label":"announcement","permalink":"/news/tags/announcement"},{"inline":true,"label":"bitcoin","permalink":"/news/tags/bitcoin"}],"readingTime":0.855,"hasTruncateMarker":true,"authors":[{"name":"Mainstream Team","title":"Core Team","url":"https://github.com/mainstreamorganization","imageURL":"https://github.com/mainstreamorganization.png","key":"mainstream","page":null}],"frontMatter":{"slug":"launch-announcement","title":"A Birthday Gift to Crypto: Mainstream Token Launches on Bitcoin\'s Anniversary","authors":["mainstream"],"tags":["launch","announcement","bitcoin"]},"unlisted":false,"nextItem":{"title":"Community Update - December 2024","permalink":"/news/community-update-dec-2024"}},"content":"{/* truncate */}\\n\\nIn a symbolic nod to the cryptocurrency that started it all, Mainstream Token ($MAIN) has chosen January 3rd, 2024 - Bitcoin\'s 15th birthday - for its official launch on the pump.fun platform.\\n\\n## Why January 3rd Matters\\n\\nOn January 3rd, 2009, Satoshi Nakamoto mined Bitcoin\'s genesis block, marking the birth of cryptocurrency. Fifteen years later, we\'re honoring this revolutionary moment by launching Mainstream Token, a project that aims to bridge the gap between human and artificial intelligence in the crypto space.\\n\\n## Launch Details\\n\\n- **Platform**: pump.fun\\n- **Date**: January 3rd, 2024\\n- **Token**: $MAIN (Mainstream Token)\\n- **Blockchain**: Solana\\n\\nJoin us as we write the next chapter in cryptocurrency history. The launch coincides with Bitcoin\'s birthday as a tribute to the innovation and decentralization principles that Bitcoin introduced to the world.\\n\\nStay tuned for more details and join our community channels to participate in this historic launch.\\n\\n*\\"In the spirit of Bitcoin\'s birthday, we\'re launching a token that represents the mainstream adoption of cryptocurrency and AI integration.\\"*"},{"id":"community-update-dec-2024","metadata":{"permalink":"/news/community-update-dec-2024","editUrl":"https://github.com/mainstreamorganization/mainstreamtoken.com/tree/main/news/2024-12-19-community-update.mdx","source":"@site/news/2024-12-19-community-update.mdx","title":"Community Update - December 2024","description":"A community update for Mainstream Token","date":"2024-12-20T00:00:00.000Z","tags":[{"inline":true,"label":"community","permalink":"/news/tags/community"},{"inline":true,"label":"update","permalink":"/news/tags/update"},{"inline":true,"label":"mainstreamtoken","permalink":"/news/tags/mainstreamtoken"},{"inline":true,"label":"blockchain","permalink":"/news/tags/blockchain"}],"readingTime":0.71,"hasTruncateMarker":true,"authors":[{"name":"Mainstream Team","title":"Core Team","url":"https://github.com/mainstreamorganization","imageURL":"https://github.com/mainstreamorganization.png","key":"mainstream","page":null}],"frontMatter":{"title":"Community Update - December 2024","description":"A community update for Mainstream Token","slug":"community-update-dec-2024","authors":["mainstream"],"tags":["community","update","mainstreamtoken","blockchain"],"date":"2024-12-20T00:00:00.000Z"},"unlisted":false,"prevItem":{"title":"A Birthday Gift to Crypto: Mainstream Token Launches on Bitcoin\'s Anniversary","permalink":"/news/launch-announcement"},"nextItem":{"title":"AI Integration in Mainstream Token","permalink":"/news/ai-integration"}},"content":"{/* truncate */}\\n\\nHello Mainstream Token community!\\n\\nWe\'re excited to share some updates on the project\'s progress and future plans.\\n\\n## Recent Developments\\n\\n-   **MTL Protocol Implementation:** We\'ve successfully implemented the core features of the MTL Protocol.\\n-   **Community Feedback:** We\'ve gathered valuable feedback from the community and are working on improvements.\\n-   **Documentation Updates:** We\'ve updated our documentation to reflect the latest changes.\\n\\n## Future Plans\\n\\n-   **Community Governance:** We\'re exploring options for implementing community governance mechanisms.\\n-   **Partnerships:** We\'re actively seeking partnerships to expand the reach of the MTL Protocol.\\n-   **New Features:** We\'re planning to add new features to the MTL Protocol based on community feedback.\\n\\n## Get Involved\\n\\nWe encourage all community members to get involved in the project. Share your ideas, provide feedback, and help us shape the future of Mainstream Token.\\n\\nStay tuned for more updates!"},{"id":"ai-integration","metadata":{"permalink":"/news/ai-integration","editUrl":"https://github.com/mainstreamorganization/mainstreamtoken.com/tree/main/news/2024-12-20-ai-integration.mdx","source":"@site/news/2024-12-20-ai-integration.mdx","title":"AI Integration in Mainstream Token","description":"Exploring the role of AI in Mainstream Token","date":"2024-12-19T00:00:00.000Z","tags":[{"inline":true,"label":"ai","permalink":"/news/tags/ai"},{"inline":true,"label":"integration","permalink":"/news/tags/integration"},{"inline":true,"label":"mainstreamtoken","permalink":"/news/tags/mainstreamtoken"},{"inline":true,"label":"blockchain","permalink":"/news/tags/blockchain"}],"readingTime":0.775,"hasTruncateMarker":true,"authors":[{"name":"Mainstream Team","title":"Core Team","url":"https://github.com/mainstreamorganization","imageURL":"https://github.com/mainstreamorganization.png","key":"mainstream","page":null}],"frontMatter":{"title":"AI Integration in Mainstream Token","description":"Exploring the role of AI in Mainstream Token","slug":"ai-integration","authors":["mainstream"],"tags":["ai","integration","mainstreamtoken","blockchain"],"date":"2024-12-19T00:00:00.000Z"},"unlisted":false,"prevItem":{"title":"Community Update - December 2024","permalink":"/news/community-update-dec-2024"},"nextItem":{"title":"Welcome to Mainstream Token","permalink":"/news/welcome"}},"content":"{/* truncate */}\\n\\nWe\'re excited to share our plans for integrating AI into the Mainstream Token ecosystem.\\n\\n## AI-Driven Governance\\n\\nWe believe that AI can play a crucial role in community governance. We\'re exploring options for using AI to:\\n\\n-   **Analyze Community Feedback:** Identify trends and patterns in community feedback.\\n-   **Automate Decision Making:** Automate certain decision-making processes based on predefined rules.\\n-   **Improve Efficiency:** Improve the efficiency of the governance process.\\n\\n## AI-Powered Content Creation\\n\\nWe\'re also exploring the use of AI to assist with content creation. This could include:\\n\\n-   **Generating Content:** Using AI to generate content for the community.\\n-   **Improving Content Quality:** Using AI to improve the quality of content.\\n-   **Personalizing Content:** Using AI to personalize content for individual users.\\n\\n## Future Plans\\n\\nWe\'re committed to exploring the full potential of AI in the Mainstream Token ecosystem. We\'ll continue to share updates on our progress.\\n\\nStay tuned for more updates!"},{"id":"welcome","metadata":{"permalink":"/news/welcome","editUrl":"https://github.com/mainstreamorganization/mainstreamtoken.com/tree/main/news/2024-12-18-welcome.md","source":"@site/news/2024-12-18-welcome.md","title":"Welcome to Mainstream Token","description":"We\'re excited to announce the launch of Mainstream Token - an AI-powered cryptocurrency community token designed to revolutionize digital asset management.","date":"2024-12-18T00:00:00.000Z","tags":[{"inline":false,"label":"Hello","permalink":"/news/tags/hello","description":"Hello tag description"},{"inline":true,"label":"mainstream","permalink":"/news/tags/mainstream"}],"readingTime":0.215,"hasTruncateMarker":true,"authors":[{"name":"Mainstream Team","title":"Core Team","url":"https://github.com/mainstreamorganization","imageURL":"https://github.com/mainstreamorganization.png","key":"mainstream","page":null}],"frontMatter":{"slug":"welcome","title":"Welcome to Mainstream Token","authors":["mainstream"],"tags":["hello","mainstream"]},"unlisted":false,"prevItem":{"title":"AI Integration in Mainstream Token","permalink":"/news/ai-integration"},"nextItem":{"title":"Mainstream Token License Protocol Launch","permalink":"/news/mtl-launch"}},"content":"\x3c!-- truncate --\x3e\\n\\nWe\'re excited to announce the launch of Mainstream Token - an AI-powered cryptocurrency community token designed to revolutionize digital asset management.\\n\\n## What\'s Next?\\n\\nStay tuned for more updates as we continue to develop our platform and grow our community."},{"id":"mtl-launch","metadata":{"permalink":"/news/mtl-launch","editUrl":"https://github.com/mainstreamorganization/mainstreamtoken.com/tree/main/news/2024-12-19-mtl-launch.mdx","source":"@site/news/2024-12-19-mtl-launch.mdx","title":"Mainstream Token License Protocol Launch","description":"Announcing the launch of the Mainstream Token License Protocol","date":"2024-12-18T00:00:00.000Z","tags":[{"inline":true,"label":"mtl","permalink":"/news/tags/mtl"},{"inline":true,"label":"launch","permalink":"/news/tags/launch"},{"inline":true,"label":"protocol","permalink":"/news/tags/protocol"},{"inline":true,"label":"mtlprotocol","permalink":"/news/tags/mtlprotocol"},{"inline":true,"label":"digitalrights","permalink":"/news/tags/digitalrights"},{"inline":true,"label":"blockchain","permalink":"/news/tags/blockchain"}],"readingTime":0.825,"hasTruncateMarker":true,"authors":[{"name":"Mainstream Team","title":"Core Team","url":"https://github.com/mainstreamorganization","imageURL":"https://github.com/mainstreamorganization.png","key":"mainstream","page":null}],"frontMatter":{"title":"Mainstream Token License Protocol Launch","description":"Announcing the launch of the Mainstream Token License Protocol","slug":"mtl-launch","authors":["mainstream"],"tags":["mtl","launch","protocol","mtlprotocol","digitalrights","blockchain"],"date":"2024-12-18T00:00:00.000Z"},"unlisted":false,"prevItem":{"title":"Welcome to Mainstream Token","permalink":"/news/welcome"}},"content":"{/* truncate */}\\n\\nWe are thrilled to announce the launch of the Mainstream Token License (MTL) Protocol! This marks a significant milestone in our journey to revolutionize digital rights management.\\n\\n## What is the MTL Protocol?\\n\\nThe MTL Protocol is a parameter-based system that uses MT tokens to define specific rights and parameters for digital assets. It allows creators to specify the terms of use for their content, and provides a transparent verification system for digital rights.\\n\\n## Key Features\\n\\n-   **Parameter-Based Licenses:** Define licenses with specific parameters such as usage rights, duration, and geographic restrictions.\\n-   **Token Ownership Verification:** Access to digital assets is verified through ownership of MT tokens.\\n-   **Transparent System:** All license parameters and ownership details are recorded on the blockchain.\\n-   **Revenue Distribution:** Facilitates revenue distribution to content creators based on license usage.\\n\\n## How to Get Started\\n\\nVisit our documentation to learn more about the MTL Protocol and how to create and manage licenses.\\n\\nStay tuned for more updates!"}]}}')}}]);